import styled from 'styled-components';

function Form({ ...props }) {
	const Form = styled.form`
		display: flex;
		padding: 2rem 0;
		flex-direction: column;
		align-items: flex-end;
		position: relative;
	`;

	return (
		<>
			<Form>{props.children}</Form>
		</>
	);
}

export default Form;
